import React from "react";
import "../styles/Footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <ul className="footer-links">
          <li><a href="/">Home</a></li>
          <li><a href="/find-a-therapist">Find a Therapist</a></li>
          <li><a href="/my-concerns">My Concerns</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/register">Register with us</a></li>
          <li><a href="/contact">Contact Us</a></li>
          <li><a href="/privacy-policy">Privacy Policy</a></li>
          <li><a href="/terms">Terms & Conditions</a></li>
        </ul>

        <div className="social-media">
          <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
            <i className="fa fa-twitter"></i>
          </a>
          <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
            <i className="fa fa-facebook"></i>
          </a>
        </div>

        <p>Â© 2025 FisioHome. All Rights Reserved. Design & Developed by <a href="#">iGex Solutions</a></p>
      </div>
    </footer>
  );
};

export default Footer;
